import numpy as np
import matplotlib.pyplot as plt
import nltk

def autolabel(rects, ax):
	"""
	Attach a text label above each bar displaying its height
	"""
	for rect in rects:
		height = rect.get_height()
		ax.text(rect.get_x() + rect.get_width()/2, 1.005*height, '%.1f' % height, ha='center', va='bottom')

def rename_pos(tag):
	if tag=="NNP" or tag=="NNPS":
		return "PN"
	elif tag=="NN" or tag=="NNS" or tag=="PRP":
		return "CN"
	elif tag=="JJ" or tag=="JJS" or tag=="JJR":
		return "ADJ"
	elif tag=="VB" or tag=="VBD" or tag=="VBG" or tag=="VBN" or tag=="VBP" or tag=="VBZ":
		return "V"
	elif tag=="RB" or tag=="RP" or tag=="RBS" or tag=="RBR":
		return "ADV"
	else:
		return "O"

